    false,nt"url": null,nt"notes": "This plan outlines the planning needs for
    Pocosin Lakes National Wildlife Refuge. The planning needs assessment describes
    the steps that must be met so that the refuge can fulfill its purpose. The refuge
    purpose is manage to provide optimum habitat for wintering migratory waterfowl and
    to restore and maintain native habitat types and their associated wildlife species.
    Target plans include hunt, safety, sign, fire, wetland, public use, law enforcement,
    hurricane preparedness, fishing, wildlife inventory, cropland, and forest.",nt"license_title":
